            <tr>
                <td>{{ commande.id }}</td>
                <td>{{ commande.username }}</td>
                <td>{{ commande.description }}</td>
                <td>{{ commande.prix }}</td>
                <td>{{ commande.dateExp ? commande.dateExp|date('Y-m-d') : '' }}</td>
